import React from "react";
import SocialItem from "./SocialItem";
function Social() {
  return (

    <ul className="list-group">
      <SocialItem
        media="Facebook"
        id="facebook"
        img=""
      /> 
      <SocialItem
      media="Youtube"
      id="youtube"
      img=""
      /> 
      <SocialItem
      media="Instagram"
      id="instagram"
      /> 
    </ul>
  );
}
export default Social;
